import React, { Fragment, useEffect} from 'react'
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from "prop-types";
//Component
import ShopItem from "./ShopItem";
import SubNavbar from "./layout/SubNavbar";
import AlertNotification from "./layout/AlertNotification";
//Actions
import { _setAlert } from '../actions/alert';



const ShopDefaultList = (props) => {
                                     useEffect(
                                       () => {
                                         document.title = `Default Page`;
                                       }
                                     );

                                     console.log(
                                       "default-list",
                                       props
                                         .location
                                         .attempt
                                     );
                                     let hasAttempt =
                                       props
                                         .location
                                         .attempt;

                                     //check if the user has been redirected after an unauthorized action
                                     if (
                                       hasAttempt
                                     ) {
                                       props._setAlert(
                                         "Unauthorized : You must first be connected",
                                         "warning"
                                       );
                                     }

                                     return (
                                       <div>
                                         <Fragment>
                                           <SubNavbar />
                                           <AlertNotification />

                                           <div className="site-section">
                                             <div className="container">
                                               <div className="row">
                                                 <div className="row col-md-12 ">
                                                   <ShopItem />
                                                   <ShopItem />
                                                   <ShopItem />
                                                   <ShopItem />
                                                   <ShopItem />
                                                   <ShopItem />
                                                 </div>

                                                 <div
                                                   className="row"
                                                   data-aos="fade-up"
                                                 >
                                                   <div className="col-md-12 text-center">
                                                     <div className="site-block-27">
                                                       <ul>
                                                         <li>
                                                           <Link to="#">
                                                             &lt;
                                                           </Link>
                                                         </li>
                                                         <li className="active">
                                                           <span>
                                                             1
                                                           </span>
                                                         </li>
                                                         <li>
                                                           <Link to="#">
                                                             2
                                                           </Link>
                                                         </li>
                                                         <li>
                                                           <Link to="#">
                                                             3
                                                           </Link>
                                                         </li>
                                                         <li>
                                                           <Link to="#">
                                                             4
                                                           </Link>
                                                         </li>
                                                         <li>
                                                           <Link to="#">
                                                             5
                                                           </Link>
                                                         </li>
                                                         <li>
                                                           <Link to="#">
                                                             &gt;
                                                           </Link>
                                                         </li>
                                                       </ul>
                                                     </div>
                                                   </div>
                                                 </div>
                                               </div>
                                             </div>
                                           </div>
                                         </Fragment>
                                       </div>
                                     );
                                   }


ShopDefaultList.propTypes = {
  _setAlert: PropTypes.func.isRequired,
};


export default connect(null, { _setAlert })(ShopDefaultList);
